import React from 'react';
import logo from '../../Images/Logo.jfif';

const Header = () => {
  return (
    <>
      <div className="header">
        <img src={logo} alt="logo" width="170" />
        <h1>Lorem Keep</h1>
      </div>
    </>
  );
};

export default Header;
